import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import Greet from './components/greet'
import Header from './components/header'


class App extends Component{
  render(){
    axios.get('/c/data')
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  return (
    <div className="App">
      <Greet />

      <Header />
    </div>
  );
  }
}

export default App;
